  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Niobrara
  National Wildlife Refuge outlines Refuge accomplishments from May through August
  of 1955. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, and fish- is also covered. The Refuge
  development and maintenance section discusses physical developments and fires. Resource
  management is outlined; topics include grazing, haying, and sharecropping.  The
  public relations section of the report describes Refuge visitors. N-R forms are
  attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
